import React, { useContext } from 'react';
import { motion } from 'framer-motion';
import {
    LayoutDashboard,
    Settings,
    Users,
    Calendar,
    DollarSign,
    TrendingUp,
    FileText,
    LogOut,
    Sun,
    Moon
} from 'lucide-react';
import { NavLink, useLocation } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { ThemeContext } from '../Layout/ThemeContext'; // Importa el ThemeContext

const Sidebar = ({ collapsed, toggleCollapse }) => {
    const { user, logout } = useAuth();
    const location = useLocation();
    const { theme, toggleTheme } = useContext(ThemeContext); // Obtiene el tema y la función toggleTheme del contexto

    const isActive = (path) => {
        return location.pathname === path;
    };

    const sidebarWidth = collapsed ? 'w-20' : 'w-60';
    const iconSize = 20;

    const menuItemVariants = {
        open: {
            y: 0,
            opacity: 1,
            transition: {
                duration: 0.1,
            },
        },
        closed: {
            y: 50,
            opacity: 0,
            transition: {
                duration: 0.1,
            },
        },
    };

    const sidebarVariants = {
        open: {
            width: '15rem',
            transition: {
                duration: 0.3,
                damping: 20,
            },
        },
        closed: {
            width: '5rem',
            transition: {
                duration: 0.3,
                damping: 20,
            },
        },
    };

    return (
        <motion.aside
            className={`bg-white border-r border-gray-200 h-full flex flex-col ${sidebarWidth} overflow-hidden`}
            variants={sidebarVariants}
            animate={collapsed ? 'closed' : 'open'}
        >
            <div className="flex items-center justify-center h-16 border-b border-gray-200 shrink-0">
                <span className="font-bold text-xl text-gray-800">
                    {collapsed ? 'SJ' : 'Sistema Parroquial'}
                </span>
            </div>

            <nav className="flex-1 p-4">
                <ul>
                    <li>
                        <NavLink
                            to="/dashboard"
                            className={`flex items-center gap-3 p-2 rounded-lg hover:bg-gray-100 transition-colors ${isActive('/dashboard') ? 'bg-gray-100 font-medium' : ''
                                }`}
                        >
                            <LayoutDashboard size={iconSize} className="text-gray-500" />
                            <motion.span
                                className="text-sm text-gray-700"
                                variants={menuItemVariants}
                            >
                                Dashboard
                            </motion.span>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink
                            to="/permissions"
                            className={`flex items-center gap-3 p-2 rounded-lg hover:bg-gray-100 transition-colors ${isActive('/permissions') ? 'bg-gray-100 font-medium' : ''
                                }`}
                        >
                            <Settings size={iconSize} className="text-gray-500" />
                            <motion.span
                                className="text-sm text-gray-700"
                                variants={menuItemVariants}
                            >
                                Permisos
                            </motion.span>
                        </NavLink>
                    </li>
                    {/* Otros elementos del menú */}
                </ul>
            </nav>
            <div className="p-4">
                <motion.button
                    onClick={toggleTheme} // Llama a la función toggleTheme al hacer clic
                    className="flex items-center gap-3 p-2 rounded-lg hover:bg-gray-100 transition-colors w-full"
                    variants={menuItemVariants}
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                >
                    {theme === 'light' ? (
                        <>
                            <Moon size={iconSize} className="text-gray-500" />
                            <span className="text-sm text-gray-700">Modo Oscuro</span>
                        </>
                    ) : (
                        <>
                            <Sun size={iconSize} className="text-gray-500" />
                            <span className="text-sm text-gray-700">Modo Claro</span>
                        </>
                    )}
                </motion.button>
                <motion.button
                    onClick={logout}
                    className="flex items-center gap-3 p-2 rounded-lg hover:bg-red-50 text-red-600 transition-colors w-full"
                    variants={menuItemVariants}
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                >
                    <LogOut size={iconSize} className="text-red-600" />
                    <span className="text-sm">Cerrar Sesión</span>
                </motion.button>
            </div>
        </motion.aside>
    );
};

export default Sidebar;
